INSERT INTO `faq_questions` (`id`, `category_id`, `question`, `answer`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 1, 'Question-1:- How do I place an order?', 'To place on order on our website first step is to register with your complete details. Second step is to add products in your cart which you want to buy. Once the total cart value meets our minimum order requirement (for India INR 5000 and for International orders USD 100) you can Check-out with the available payment options.', 1, '2021-12-17 19:48:43', '2021-12-17 19:48:43', NULL),
(2, 1, 'Question-2:- How long does it take for me to get my order?', 'We have all items ready in stock and we ship them within two working days of receiving clear payments. We use reputed couriers to ship the products and it takes maximum five to seven working days to get delivered to your doorstep under normal conditions.', 1, '2021-12-17 19:50:25', '2021-12-17 19:50:25', NULL),
(3, 1, 'Question-3:- What is your minimum order?', 'Minimum order value for Indian customers is INR 5000 and for International customers it is USD 100.', 1, '2021-12-17 19:50:41', '2021-12-17 19:50:41', NULL),
(4, 1, 'Question-4:- How can the order be treated as a confirmed order, Any advance payment required?', 'We have two types of payment processes. First process is, purchase from our website directly which products are showing on our website. Add products in cart, checkout and make payment and after payment we will dispatch the order.', 1, '2021-12-17 19:50:57', '2021-12-17 19:50:57', NULL),
(5, 1, 'Question-5:- Can I order more items than what are currently in stock?', 'Yes you can do that but you have to contact us for the same.', 1, '2021-12-17 19:51:14', '2021-12-17 19:51:14', NULL),
(6, 1, 'Question-6:- How do I check the status of my order?', 'In order the check the current status of your order you need to got to My Account and check under My orders tab. You will find here all the details pertaining to your previous orders.', 1, '2021-12-17 19:51:32', '2021-12-17 19:51:32', NULL),
(7, 1, 'Question-7:- What is the cancellation Process?', '1. Cancellations will be considered only if the request is made before the order has been dispatched / shipped at our end.\r\n\r\n2. There will not be any cancellation if the order has been dispatched / shipped.\r\n\r\n3. No cancellations are entertained for those products that the Eindiawholesale.com marketing team has obtained for special Festival occasions. These are limited occasion offers and therefore cancellations are not possible.', 1, '2021-12-17 19:52:31', '2021-12-17 19:52:31', NULL),
(8, 1, 'Question-8:- How do I track my order after it has been shipped or if it is not delivered within the standard time?', 'In this case, please contact to our customer support team.  We will revert you after discuss from our logistic support partners.', 1, '2021-12-17 19:52:49', '2021-12-17 19:52:49', NULL),
(9, 1, 'Question-9:- Is Ordering online safe?', 'Yes it is 100% safe.\r\n\r\nThe payment gateways integrated on our website are 100% secured and safe for all the online transactions. We do not store any of your financial information.', 1, '2021-12-17 19:53:18', '2021-12-17 19:53:18', NULL),
(10, 1, 'Question-10:- Can you give me a special discount on ordering jewelry in a big quantity?', 'Yes we give special discounts.', 1, '2021-12-17 19:53:44', '2021-12-17 19:53:44', NULL);
